import styled from "styled-components";

export const MenuStyles = styled.div`
  width: 100%;
  height: 60vh;

  position: absolute;
  top: 0;
  right: 0;

  display: flex;
  justify-content: center;
  align-items: center;
  text-align: center;

  font-family: "Cormorant Infant", serif;
  font-size: 2em

  background: darkcyan;
`;
